import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { StudentSsoFeePaymentRoutingModule } from './student-sso-fee-payment-routing.module';
import { StudentSsoFeePaymentComponent } from './student-sso-fee-payment.component';
import { LoaderModule } from '../../Shared/loader/loader.module';
import { FormsModule } from '@angular/forms';

@NgModule({
  declarations: [
    StudentSsoFeePaymentComponent
  ],
  imports: [
    CommonModule,
    StudentSsoFeePaymentRoutingModule,
    LoaderModule, FormsModule
  ]
})
export class StudentSsoFeePaymentModule { }
